import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ViewBunks = () => {
  const [bunks, setBunks] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchBunks = async () => {
      try {
        const response = await axios.get('/api/admin/ev-bunks', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        setBunks(response.data);
      } catch (err) {
        setError('Failed to fetch bunks: ' + (err.response?.data?.message || err.message));
      }
    };

    fetchBunks();
  }, []);

  return (
    <div className="max-w-6xl mx-auto p-8">
      <h2 className="text-3xl font-semibold mb-6">EV Bunk List</h2>

      {error && <p className="text-red-600 mb-4">{error}</p>}

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {bunks.map((bunk) => (
          <div key={bunk._id} className="p-6 border rounded-lg shadow hover:shadow-md">
            <h3 className="text-xl font-bold mb-2">{bunk.name}</h3>
            <p><strong>Address:</strong> {bunk.address}</p>
            <p><strong>Phone:</strong> {bunk.phone}</p>
            <p><strong>Slots Available:</strong> {bunk.slotsAvailable}</p>
            <p><strong>Operating Hours:</strong> {bunk.operatingHours || 'N/A'}</p>
            <p><strong>Connector Types:</strong> {bunk.connectorTypes || 'N/A'}</p>
            <p><strong>Location:</strong> {bunk.latitude}, {bunk.longitude}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ViewBunks;
